import React, { Component } from 'react';

export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      value: 5,
    };
  }
  updater = ()=>{
    this.setState({value: this.state.value+1})
  }
  render() {
    return (
      <button
        className="square"
        onClick={this.updater}
      >
        {this.state.value}
      </button>
    );
  }
}
